// src/pages/ChatBotPage.jsx

import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import FAQModal from '../components/FAQModal';

const ChatBotPage = () => {
  const navigate = useNavigate();
  const [isFAQOpen, setIsFAQOpen] = useState(false);
  const [messages, setMessages] = useState([
    { sender: 'bot', text: '안녕하세요! 무엇을 도와드릴까요?' },
  ]);
  const [input, setInput] = useState('');
  const [loading, setLoading] = useState(false);

  const toggleFAQ = () => setIsFAQOpen(prev => !prev);

  const handleSend = async () => {
    if (!input.trim()) return;
    // 1) 사용자 메시지 추가
    const newUserMsg = { sender: 'user', text: input };
    setMessages(prev => [...prev, newUserMsg]);
    setInput('');
    setLoading(true);

    // 2) 백엔드 호출
    try {
      const res = await fetch('http://localhost:8001/chat', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ user_input: input }),
      });
      const { response } = await res.json();
      // 3) 봇 응답 추가
      setMessages(prev => [...prev, { sender: 'bot', text: response }]);
    } catch {
      setMessages(prev => [
        ...prev,
        { sender: 'bot', text: '⚠️ 서버 연결에 실패했습니다.' },
      ]);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={styles.page}>
      {/* 헤더 */}
      <div style={styles.header}>
        <h2
          style={{ ...styles.headerText, cursor: 'pointer' }}
          onClick={() => navigate('/home')}
        >
          AI Care 챗봇
        </h2>
        <button style={styles.faqBtn} onClick={toggleFAQ} title="FAQ 보기">
          ❓
        </button>
      </div>

      {/* 채팅 영역 */}
      <div style={styles.chatArea}>
        {messages.map((msg, idx) => (
          <div
            key={idx}
            style={{
              ...styles.message,
              ...(msg.sender === 'user'
                ? styles.userMessage
                : styles.botMessage),
            }}
          >
            {msg.text}
          </div>
        ))}
        {loading && (
          <div style={{ textAlign: 'left', marginBottom: 8 }}>
            <span style={styles.loadingBubble}>
              챗봇이 응답을 생성 중입니다...
            </span>
          </div>
        )}
      </div>

      {/* 입력창 */}
      <div style={styles.inputArea}>
        <input
          style={styles.input}
          placeholder="메시지를 입력하세요..."
          value={input}
          onChange={e => setInput(e.target.value)}
          onKeyDown={e => e.key === 'Enter' && handleSend()}
        />
        <button
          style={styles.sendBtn}
          onClick={handleSend}
          disabled={!input.trim() || loading}
        >
          전송
        </button>
      </div>

      {/* FAQ 모달 */}
      {isFAQOpen && <FAQModal onClose={toggleFAQ} />}
    </div>
  );
};

const styles = {
  page: {
    display: 'flex',
    flexDirection: 'column',
    height: '100vh',
    background: '#fff',
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    color: '#333',
  },
  header: {
    background: '#f7f7f7',
    padding: '16px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    borderBottom: '1px solid #ddd',
  },
  headerText: {
    margin: 0,
    fontSize: '20px',
    fontWeight: '600',
    color: '#4a4a4a',
  },
  faqBtn: {
    background: '#eaeaea',
    color: '#555',
    border: '1px solid #ddd',
    borderRadius: '50%',
    width: '38px',
    height: '38px',
    fontSize: '18px',
    fontWeight: 'bold',
    cursor: 'pointer',
    transition: 'all 0.25s ease',
  },
  chatArea: {
    flex: 1,
    padding: '20px',
    overflowY: 'auto',
    display: 'flex',
    flexDirection: 'column',
    gap: '12px',
    background: '#fafafa',
  },
  message: {
    maxWidth: '75%',
    padding: '12px 16px',
    borderRadius: '12px',
    fontSize: '15px',
    lineHeight: '1.5',
    wordBreak: 'break-word',
  },
  userMessage: {
    alignSelf: 'flex-end',
    background: '#d9eaff',
    color: '#222',
    borderTopRightRadius: 0,
  },
  botMessage: {
    alignSelf: 'flex-start',
    background: '#f1f1f1',
    color: '#333',
    borderTopLeftRadius: 0,
  },
  loadingBubble: {
    display: 'inline-block',
    background: '#eee',
    padding: '8px 12px',
    borderRadius: 16,
    fontStyle: 'italic',
  },
  inputArea: {
    display: 'flex',
    padding: '12px',
    borderTop: '1px solid #ddd',
    background: '#fff',
  },
  input: {
    flex: 1,
    padding: '12px',
    borderRadius: '8px',
    border: '1px solid #ccc',
    outline: 'none',
    fontSize: '15px',
    background: '#fff',
    color: '#333',
  },
  sendBtn: {
    marginLeft: '8px',
    padding: '12px 20px',
    border: 'none',
    borderRadius: '8px',
    background: '#4a90e2',
    color: '#fff',
    fontWeight: 'bold',
    cursor: 'pointer',
    transition: 'background 0.3s ease',
  },
};

export default ChatBotPage;
